const ApiUtil = require("../util/api_util")
const apiUtil = new ApiUtil();

//交易签名数据可以通过签名接口获取，参考sign_demo_721/sign_demo_1155
let signedTx = {
    txHash:"0xa9253d8c5e9c3446b045f87332bde7988bf783a09eb6bc3928a84287af7e7b0a",
    signed:""
}
main();
async function main(){
  try{
    console.log("测试发送交易\n");

    let response = await apiUtil.sendTx(signedTx.txHash,signedTx.signed,"");
    if(response.code === "EC000001"){
        console.log("交易发送成功");
    }else{
        console.log("交易发送失败");
    }
  }catch(e){
    console.error(e);
  }
}